import './style.css'
import React,{useState,useEffect} from 'react'
import Nav from '../Navbar'
import Card from '../Card'
import Form from '../Form'

const App = () => {

  return (
    <div className="App">
      <Nav />
      <Form />
      <Card />
    </div>

  );
}

export default App;
